        name: 'WuMajesty'
      },
      {
        path:'customer/sign-up',
        component: SignUp,
        name: 'SignUp'
      },
    ]
  },

  {
    path:'/secret/security/administrator/admin-page',
    component: AdminPage,
    name: 'AdminPage'
  }
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
